import { get, post, patch, put, del } from './axios-c';
const API_KEY = "AIzaSyCvHcIZbtF80KUW23vCV_kmmr2EVixerAI";
const mpc = "https://maps.googleapis.com/maps/api/place";


export const _login = async (data) => await post('/loc/users/login', data)

export const _getUserList = async () => await get(`/loc/users`)
export const _delUser = async (id) => await get(`/loc/users/del?id=${id}`)



export const _addPlace = async (data) => await post('/loc/addPlace', data)
export const _saveJson = async (data) => await post('/loc/saveJson', data, {
    headers: {
        "Content-Type": "application/x-www-form-urlencoded"
    }
})
export const _saveReviewsJson = async (data) => await post('/loc/saveReviewsJson', data, {
    headers: {
        "Content-Type": "application/x-www-form-urlencoded"
    }
})
export const _updateText = async (data) => await post('/loc/updateText', data, {
    headers: {
        "Content-Type": "application/x-www-form-urlencoded"
    }
})
export const _getJson = async () => await get('/loc/getJson')


export const _getPidsList = async (url) => await get(`${mpc}${url}`)

export const _getPinfosList = async (url) => await get(`${mpc}${url}`)

export const _getPlaceInfo = async (id) => await get(`/loc/getPlaceInfo?place_id=${id}`)


export const _getFavsList = async (id) => await get(`/loc/getFavsList?user_id=${id}`)

export const _getPlacesLists = async () => await get(`/loc/getPlacesLists`)
